import React from "react";
import { NavLink } from "react-router-dom";
import './index.css';
const Navbar = () => {
  return (
    <>
      <NavLink exact activeClassName="liko" to='about/:'>About </NavLink>
      <NavLink exact activeClassName="liko" to='Contact'> Contact </NavLink>
    </>
  )
}
export default Navbar;
